import { combineReducers } from "redux";
import {login} from '../Pages/loginReducer';

const rootReducer =  (state = {}, { type, payload }) => {
  debugger
    switch (type) {
      case 'SET_USER':
        return payload;


      case 'CLEAR_USER':
        return {};
      case 'SET_User_LIST_RESPONSE':
        return {
          ...state,
          UserListResponse : payload
        }
      default:
        return state;
    }
  };
  export default combineReducers({
    rootReducer,
   loginReducer,
  })
